import './App.css';
import './styles/Landingpage.css'
import './styles/Login.css'
import './styles/Welcome.css'
import './styles/Select.css'
import './styles/Layout.css'
import './styles/Navbar.css'
import './styles/Button.css'

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Landingpage from './components/LandingPage'
import Login from './components/Login';
import Welcome from './components/Welcome';
import Select from './components/Select';
import OrderApproved from './components/OrderApproved'
import Confirm from './components/Confirm'
import Notification from './components/Notification';
import pic from './assets/got.png'



function App() {
  return (
    <div className='background-img'><img src={pic} className='object-cover' alt="bg"></img>
    <Router>
      <Routes>
        <Route exact path='/' element={<Landingpage />} />
        <Route exact path='/Login' element={<Login />} />
        <Route exact path='/Welcome' element={<Welcome />} />
        <Route exact path='/Select' element={<Select />} />
        <Route exact path='/Confirm' element={<Confirm />} />
        <Route exact path='/OrderApproved' element={<OrderApproved />} />
        <Route exact path='/Notification' element={<Notification />} />
      </Routes>
    </Router>
    </div>
  );
}
export default App;
